import React from 'react';
import fire from '../Config/Config';
class Logout extends React.Component{
logout(){
    fire.auth().signOut();
}
    render(){
        return(
           <div>
               <a href="/"><button onClick={this.logout}>logout</button></a>
           </div>
        )
    }
}
export default Logout;
